  title: { rendered: "Shinjuku Gyoen National Garden" },
  content: {
    rendered:
      '<p>Shinjuku Gyoen National Garden (新宿御苑 Shinjuku Gyoen) is a large park with an eminent garden in Shinjuku and Shibuya, Tokyo, Japan. It was originally a residence of the Naitō family in the Edo period. Afterwards, it became a garden under the management of the Imperial Household Agency of Japan. <!--more-->It is now a park under the jurisdiction of the national Ministry of the Environment.</p>\n<p>The shogun bequeathed this land to Lord Naitō (daimyo) of Tsuruga in the Edo period who completed a garden here in 1772. After the <a href="https://en.wikipedia.org/wiki/Meiji_Restoration" target="_blank" rel="noopener">Meiji Restoration</a> the house and its grounds were converted into an experimental agricultural centre. It then became a botanical garden before becoming an imperial garden in 1879. The current configuration of the garden was completed in 1906. <strong>Most of the garden was destroyed</strong> by air raids in 1945, during the later stages of World War II. The garden was rebuilt after the war.</p>\n<h2>More than 20,000 trees</h2>\n<figure id="attachment_77" aria-describedby="caption-attachment-77" style="width: 840px" class="wp-caption alignnone"><a href="https://flic.kr/p/5H2sDW"><img class="wp-image-77 size-large" src="https://i0.wp.com/test.frontity.org/wp-content/uploads/2016/11/ShinjukuGyoen.jpg?resize=840%2C558" alt="Shinjuku Gyoen" width="840" height="558" srcset="https://i0.wp.com/test.frontity.org/wp-content/uploads/2016/11/ShinjukuGyoen.jpg?w=1024&amp;ssl=1 1024w, https://i0.wp.com/test.frontity.org/wp-content/uploads/2016/11/ShinjukuGyoen.jpg?resize=300%2C199&amp;ssl=1 300w, https://i0.wp.com/test.frontity.org/wp-content/uploads/2016/11/ShinjukuGyoen.jpg?resize=768%2C510&amp;ssl=1 768w" sizes="(max-width: 709px) 85vw, (max-width: 909px) 67vw, (max-width: 1362px) 62vw, 840px" data-recalc-dims="1" /></a><figcaption id="caption-attachment-77" class="wp-caption-text">Shinjuku Gyoen National Garden by Hiroshiykw.</figcaption></figure>\n<p>The garden has more than 20,000 trees, including approximately 1,500 cherry trees which bloom from late March (Shidare or Weeping Cherry), to early April (Somei or Tokyo Cherry), and on to late April (Kanzan Cherry). Other trees found here include the majestic <strong>Himalayan cedars</strong>, which soar above the rest of the trees in the park, tulip trees, cypresses, and plane trees, which were first planted in Japan in the Imperial Gardens.</p>\n<p>Horticulture work has been going on in the greenhouses in the garden since 1892. The present greenhouse, built in the 1950s has a stock of over 1,700 tropical and subtropical plant species on permanent display.</p>\n<p>You may also like our <a href="/banff-national-park/">post about the Banff National Park</a> in Canada.</p>\n<p>Source: <a href="https://en.wikipedia.org/wiki/Shinjuku_Gyoen">Shinjuku Gyoen</a>.<br />\nPhoto: Shinjuku Gyoen National Garden by <a href="https://flic.kr/p/5H2sDW" target="_blank" rel="noopener">Hiroshiykw</a>.<br />\nTags: <a href="/tag/japan">Japan</a>, <a href="/tag/tokyo/">Tokyo</a>, <a href="/tag/national-garden/">National Garden</a></p>\n<p><a href="/about-us/">About us</a>.</p>\n',
    protected: false,
  },
